export default function GhanaMap() {
  const [hoveredRegion, setHoveredRegion] = useState(null)
  const navigate = useNavigate()

  return (
    <div className="relative w-full aspect-[4/5] max-w-2xl mx-auto">
      <svg
        viewBox="0 0 600 800"
        className="w-full h-full drop-shadow-2xl"
      >
        {regions.map((region) => (
          <path
            key={region.name}
            d={region.path}
            className={`transition-all duration-300 cursor-pointer stroke-[1.5] ${
              hoveredRegion === region.name
                ? 'fill-primary stroke-white scale-[1.01] z-10 shadow-lg shadow-primary/20'
                : 'fill-white stroke-slate-200 hover:fill-primary/20'
            }`}
            onMouseEnter={() => setHoveredRegion(region.name)}
            onMouseLeave={() => setHoveredRegion(null)}
            onClick={() => navigate('/institutions?region=' + encodeURIComponent(region.name))}
          >
            <title>{region.name}</title>
          </path>
        ))}
      </svg>
      {hoveredRegion && (
        <div className="absolute top-0 right-0 bg-white/90 backdrop-blur-sm p-4 rounded-xl shadow-xl border border-slate-100 animate-in fade-in slide-in-from-top-2 pointer-events-none">
          <p className="text-xs text-muted-foreground uppercase tracking-widest font-bold">Region</p>
          <p className="text-xl font-bold text-primary">{hoveredRegion}</p>
          <p className="text-sm text-slate-500 mt-1">Click to view institutions</p>
        </div>
      )}
      <div className="absolute bottom-0 left-0 bg-slate-100/50 backdrop-blur-[2px] p-2 rounded text-[10px] text-slate-400 uppercase tracking-tighter">
        Interactive Regional Explorer
      </div>
    </div>
  )
}
